import React, { Component } from 'react';
import {login} from '../login/login-api'
import { Redirect } from 'react-router-dom';
import {
    Form,
    Input,
    // Tooltip,
    Icon,
    // Cascader,
    // Select,
    // Row,
    // Col,
    // Checkbox,
    // Button,
    // AutoComplete,
    notification
  } from 'antd';

const FormItem = Form.Item;

class Login extends Component {
    render() {
        const AntWrappedLoginForm = Form.create()(LoginForm);
        return (
            <AntWrappedLoginForm />           
        );
    }
}

class LoginForm extends Component  {
    constructor(props) {
        super(props);
        this.state = {
            redirectMe: {
                status:false,
                path:''
            }
           }
        this.onSubmitExperience = this.onSubmitExperience.bind(this);

    }

    onSubmitExperience = (e) => {
        e.preventDefault();

        this.props.form.validateFields((err, values) => {
            if (!err) {
                const loginRequest = Object.assign({}, values);
                console.log(values);
                let loginRequests=values;
                console.log(loginRequest);
                loginRequest.data={};
                console.log(loginRequest);
                const logReq = {...values};
                console.log(logReq);
                login(values)
                .then(response=>{
                    console.log(response);
                    notification['success']({
                        message: 'MEDTHREAT',
                        description:
                          'Successfully Logged In.',
                      });


                    this.props.form.resetFields();
                    this.setState({redirectMe: {
                        status:true,
                        path:'/dashboard'
                        }
                    })
                }).
                catch((error)=> {
                    if(error.response){
                      console.log(error.response);
                      if(error.response.status == 400){
                        notification['error']({
                            message: 'MEDTHREAT',
                            description:
                              `Username/Password Incorrect.`,
                          });
                            console.log(error.response.status);
                      }else{
                        notification['error']({
                            message: 'MEDTHREAT',
                            description:
                              `An Error occured .`,
                          });

                        console.log(error.response.status);
                      }
                    }
                });

            }
        });
    }

  render() {
    if(this.state.redirectMe.status){
        console.log("Reiercting");
        return <Redirect to={this.state.redirectMe.path} />
    }
    const {getFieldDecorator} = this.props.form;

    return (
        <div className="bg-dark" 
        style={{height: "100vh", display: "flex", alignItems: "center",justifyContent: "center"}}>
            <div className="bg-dark sufee-login d-flex align-content-center flex-wrap" style={{height:"100%", width:"100%"}}>
                <div className="container">
                    <div className="login-content">
                        <div className="login-logo">
                            <a href="index.html">
                                <img className="align-content" src="/images/logo.png" alt="" />
                            </a>
                        </div>
                        <div className="login-form">
                            <form onSubmit={this.onSubmitExperience}>
                                <div className="row">
                                    <div className="col-md-12">
                                        <FormItem>
                                            {getFieldDecorator('username', {
                                                rules: [
                                                    {
                                                        required: true,
                                                        message: 'Please input your email!'
                                                    }
                                                ]
                                            })(
                                                <Input
                                                    className="form-control"
                                                    prefix={<Icon type="user"/>}
                                                    name="username"
                                                    placeholder=" Email"
                                                />
                                            )}
                                        </FormItem>
                                    </div>
                                </div>


                                <div className="row">
                                    <div className="col-md-12">
                                        <FormItem>
                                            {getFieldDecorator('password', {
                                                rules: [
                                                    {
                                                        required: true,
                                                        message: 'Please input your Password!'
                                                    }
                                                ]
                                            })(
                                                <Input
                                                    prefix={<Icon type="lock"/>}
                                                    name="password"
                                                    type="password"
                                                    placeholder="Password"
                                                />

                                            )}
                                        </FormItem> 
                                    </div>
                                </div>

                                <FormItem>
                                    <button type="submit" className="btn btn-primary btn-flat m-b-30 m-t-30">Register</button>
                                </FormItem>                                        
                                <div className="register-link m-t-15 text-center">
                                    <p>Already have account ? <a href="#"> Sign in</a></p>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
  }
}

export default Login;
